create table staff_data (
	id INT,
	first_name VARCHAR(50),
	last_name VARCHAR(50),
	gender VARCHAR(50),
	date_of_birth DATE,
	health_card_number VARCHAR(50),
	SIN VARCHAR(50),
	university VARCHAR(50),
	home_address VARCHAR(50),
	email VARCHAR(50),
	employment_id VARCHAR(50),
	job_role VARCHAR(50),
	pay VARCHAR(50),
	manager VARCHAR(50)
);
